import React from 'react'
import LinkRouter from '../components/LinkRouter'

export default {
  title: 'Link Router',
  component: LinkRouter
}

export function LinkContainer() {

  const to = `/${pathnames.slice(0, index + 1).join('/')}`;

  return (
    <div>
      <LinkRouter
        to="somewhere"
        key={to}
      >
      </LinkRouter>
    </div>
  )
}
